import React from "react";
import AppLayout from "../components/AppLayout";
import Todo from "../components/Todo";

const Home = () => {
  const TodoList = [{ thing: "밥먹기" }, { thing: "잠자기" }];
  return (
    <AppLayout>
      <TodoList data={TodoList} />
    </AppLayout>
  );
};

export default Home;
